import { useNavigate } from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from "./firebase-config";

export default function SignOut() {
    const navigate = useNavigate();

    const SignOut = async () => {
        try{
            await signOut(auth)
            console.log("Sucessfully signed out");
            navigate("/login");
        }
        catch(error){
            console.log(error);
        }

    };

    return(
        SignOut()
    )

};
